import React, { Component } from "react";

import classes from "./WorkComponent.module.css";
import "../../../../node_modules/@fortawesome/fontawesome-free/css/all.css";
import { CopyToClipboard } from "react-copy-to-clipboard";

class WorkComponent extends Component {
  state = {
    copied: false,
  };
  render() {
    return (
      <li className={classes.Work}>
        <div className={classes.Label}>Dota 2</div>
        <div className={classes.Description}>
          <style>
            @import
            url('https://fonts.googleapis.com/css2?family=Langar&family=Pacifico&family=Questrial&display=swap');
          </style>
          Come in and play Dota, do not regret what you did,only fans will be
          able to understand your pain ant tears
        </div>

        <div className={classes.Password}>
          <style>
            @import
            url('https://fonts.googleapis.com/css2?family=Andika+New+Basic:ital@1&display=swap');
          </style>
          password: <font className={classes.PasswordFont}>zabastovka2002</font>
          <CopyToClipboard
            onCopy={() => this.setState({ copied: true })}
            text="zabastovka2002"
          >
            <div className={classes.clipBoard}>
              <i class={this.state.copied ? "fas fa-copy" : "far fa-copy"}></i>
            </div>
          </CopyToClipboard>
        </div>
        <div className={classes.Users}>
          <div className={classes.UserGroup}>
            <i class="fa fa-users" aria-hidden="true">
              :5
            </i>
          </div>
          <div>

            <i class="fas fa-user-tie">:2</i>
          </div>

          <i class="fas fa-hospital-user">:3</i>
        </div>
      </li>
    );
  }
}
export default WorkComponent;
